// ── Main App ──────────────────────────────────────────────────
export default function YemenHealthApp() {
  const [activeNav, setActiveNav] = useState("home");

  useEffect(() => {
    document.title = "يمن هيلث 2026 — بوابة اليمن الصحية";
    // Load Cairo font
    const link = document.createElement("link");
    link.href = "https://fonts.googleapis.com/css2?family=Cairo:wght@300;400;600;700;900&display=swap";
    link.rel = "stylesheet";
    document.head.appendChild(link);

    const handleScroll = () => {
      const sections = ["home","editions","packages","agenda","testimonials","register"];
      for (const id of sections) {
        const el = document.getElementById(id);
        if (el) {
          const rect = el.getBoundingClientRect();
          if (rect.top <= 100 && rect.bottom >= 100) { setActiveNav(id); break; }
        }
      }
    };
    window.addEventListener("scroll", handleScroll);
    return () => window.removeEventListener("scroll", handleScroll);
  }, []);

  return (
    <div style={{ direction: "rtl", fontFamily: "'Cairo',sans-serif" }}>
      <Navbar active={activeNav} setActive={setActiveNav} />
      <HeroSection />
      <StatsStrip />
      <EditionsSection />
      <PackagesSection />
      <AgendaSection />
      <TestimonialsSection />
      <RegisterSection />
      <Footer />
    </div>
  );
}
